COMPONENT.script:
			initialize()=
declare
    name = varchar(256) not null default 'Sponge Bob';
enddeclare
{
    superheroes[1].name = 'Chuck Norris';
    superheroes[1].power = 9999;

    superheroes[2].name = 'Bruce Lee';
    superheroes[2].power = 9000;

    superheroes[3].name = 'Jackie Chan';
    superheroes[3].power = 7000;

    superheroes[4].name = 'Jet Li';
    superheroes[4].power = 8000;
}
on click set_button =
{
     superheroes[1].name = name;	
}
on click get_button =
{
      name = superheroes[1].name;	
}

